import React from 'react';
import ImageText from './ImageText';
import bg1 from './images/banner.jpg';
import bg2 from './images/banner2.png';
import './App.css';

function Body() {
  return (
    <div>
      <ImageText first="My name is" head="Michael Read" last="Welcome!" img={bg1} dark='true'/>
      <ImageText img={bg2}/>
    </div>
  );
}

export default Body;
